import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { InstructorDashboardComponent } from './dashboard/dashboard.component';
import { ManageBatchesComponent } from './manage-batches/manage-batches.component';
import { CreateBatchComponent } from './create-batch/create-batch.component';
import { ViewBookingsComponent } from './view-bookings/view-bookings.component';
import { SharedModule } from '../shared/shared.module';
import { RouterModule } from '@angular/router';
import { EditBatchComponent } from './edit-batch/edit-batch.component';
import { FormsModule } from '@angular/forms';
// import { CreateCourseComponent } from './instructor/create-course.component';



@NgModule({
  declarations: [
    InstructorDashboardComponent,
    ManageBatchesComponent,
    CreateBatchComponent,
    ViewBookingsComponent,
    EditBatchComponent,

  ],
  imports: [
    CommonModule,
    SharedModule,
    RouterModule,
    FormsModule
  ]
})
export class InstructorModule { }
